import React, { useState } from "react";
import 'antd/dist/antd.css';
import {Link} from 'react-router-dom';
import { Input, Switch} from 'antd';
import {
  Navbar,
  Nav,
  Form,
  FormControl,
  Button,
  NavDropdown,
} from "react-bootstrap";
import logo from "../images/icon.png";
import classes from "./Navbar.module.css";
import { DragSwitch } from "react-dragswitch";
import Search from "antd/lib/input/Search";


const Navba = (props) => {
  const [checked, setChecked] = useState(false);
  const [col,setcol]=useState("black")
  //false
  let inputStyle = {
    color: 'white'
  }
  //true
  let inputStyle2 ={
    color:'black'
  }
  function onChange(checked){
    if (checked){
      props.ColorChanger()
      setcol(inputStyle2.color);
      console.log(col)
    }
    else{
      props.ColorChanger()
      setcol(inputStyle.color);
      console.log(col)
    }
  }
  return (
    
    <Navbar  collapseOnSelect expand="lg" bg="black" variant="dark">
      
     <Navbar.Brand style={{color:`${col}`}} className={classes.icon} href="/">
        <img
          alt=""
          src={logo}
          width="30"
          height="30"
          className="d-inline-block align-top"
        />{" "}
        CoinStats
      </Navbar.Brand>
     
      <Switch defaultChecked onChange={onChange}/>
      
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav  className="ml-auto" >
        <Nav.Link style={{color:`${col}`}}  href="#fe">portfolio Tracker</Nav.Link>
        <Nav.Link style={{color:`${col}`}} href="/">Live Pricing</Nav.Link>
          <Nav.Link style={{color:`${col}`}} href="/pricing">Pricing</Nav.Link>
          <Nav.Link style={{color:`${col}`}} href="/alert">Alerts</Nav.Link>
          <NavDropdown style={{color: "black"}} bg="black" title={<span>Currenc</span>} id="collasible-nav-dropdown">
            <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.2">
              Another action
            </NavDropdown.Item>
            <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#action/3.4">
              Separated link
            </NavDropdown.Item>
          </NavDropdown>
          <NavDropdown style={{background: "black"}} title="Language" id="collasible-nav-dropdown">
            <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.2">
              Another action
            </NavDropdown.Item>
            <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#action/3.4">
              Separated link
            </NavDropdown.Item>
          </NavDropdown>
        
        </Nav>
        <Form inline>
          <Input placeholder="Search" style={{ borderRadius: "15px"}} suffix={`${<i class="far fa-search"></i>}`}/>
        </Form>
        <Nav>
          <Link to="/login"><Nav.Link  style={{color:`${col}`}} href="/login">Login</Nav.Link></Link>
          <Nav.Link className={`${classes.bta} btn`} style={{color:`${col}`}} eventKey={2} href="/getstarted">
            Get Started
          </Nav.Link>
        </Nav>
      </Navbar.Collapse>
      
    </Navbar>
    
  );
};

export default Navba;
